var fieldStreetName, fieldStreetNameEnglish, fieldLastHouseNumber, fieldNextHouseNumber, fieldStreet;
$(function () { //после загрузки страницы маштабирует элементы формы и записывает временные даанные (размеры элементов)
	var width = $(".fields").width(), height = $(".fields").height();
	$(".fields-left").width(width - height - 1);
	$(".fields-right").width(height);

	$('#fieldStreetName').width(width - height - 300);
	$('#fieldLastHouseNumber').width(65);
	$('#fieldNextHouseNumber').width(86);

	$("#eac-container-fieldStreetName").width($("#fieldStreetName").width() + 4);
	$('#eac-container-fieldStreetName').css('left', $("#fieldStreetName").position().left + 'px');

	fieldStreetName = width - height - 300;
	fieldStreetNameEnglish = $("#fieldStreetNameEnglish").width();
	fieldLastHouseNumber = $("#fieldLastHouseNumber").width();
	fieldNextHouseNumber = $("#fieldNextHouseNumber").width();
	fieldStreet = $("#fieldStreet").width();
});




function resizeForm() { //отвечает за ширину формы

	//проверяет на пустоту поле ввода

	if ($('#fieldStreetName').val() == "")
		$('#fieldStreetName').width(fieldStreetName);

	if ($('#fieldStreetNameEnglish').val() == "")
		$('#fieldStreetNameEnglish').width(fieldStreetNameEnglish);

	if ($('#fieldLastHouseNumber').val() == "")
		$('#fieldLastHouseNumber').width(fieldLastHouseNumber);

	if ($('#fieldNextHouseNumber').val() == "")
		$('#fieldNextHouseNumber').width(fieldNextHouseNumber);

	if ($('#fieldStreet').val() == "")
		$('#fieldStreet').width(fieldStreet);

	$("#fieldStreetName").autosizeInput();
	$('#fieldLastHouseNumber').autosizeInput();
	$('#fieldNextHouseNumber').autosizeInput();
	$('#fieldStreet').autosizeInput();

	//отвечает за ширину формы

	var streetName = $("#fieldStreetName").width() + 250;
	var height = $(".fields").height();
	$(".fields-left").width((streetName < 825) ? 825 : streetName);
	$(".fields").width((streetName < 825) ? 825 + height : streetName + height);
	
	var size = $("#fieldStreetName").width() + 4;
	var sizeBlock = $(".fields-left").width();
	$("#eac-container-fieldStreetName").width(size<250 ? 250 : size);
	if(size<250)
	{
		$('#eac-container-fieldStreetName').css('left', (sizeBlock - 250)/2  + 'px');
	}
	else
	{
		$('#eac-container-fieldStreetName').css('left', $("#fieldStreetName").position().left + 'px');
	}

	var fontSize = 148;
	$('#fieldHouseNumber').css({ fontSize: fontSize + 'px' }); //масштабирование текста в зависимости от его длины
	while (getWidthOfText("#fieldHouseNumber") > ($("#fieldHouseNumber").width() - 45)) {
		fontSize -= 1;
		$('#fieldHouseNumber').css({ fontSize: fontSize + 'px' });
	}
}

function getWidthOfText(txt) { //определение длины текста в пикселях
	var c = document.createElement('canvas');
	var ctx = c.getContext('2d');
	ctx.font = $(txt).css('font-size') + " " + $(txt).css('font-family');
	var length = ctx.measureText($(txt).val()).width;
	return Math.round(length);
}

$(document).on("input", function (ev) {//вызывает функцию переопределения размеров элементов
	resizeForm();
});

$('#fieldStreetName').focus(function(){
	$(this).select();
});

function editBound() { //экспорт изображения

	var width = $(".fields").width(), height = $(".fields").height();

	var inputLeftSize = $("#fieldStreet").css('font-size');
	inputLeftSize = +inputLeftSize.slice(0, inputLeftSize.indexOf('p'));

	var InputLeftHeight = inputLeftSize / 4;

	var centrLeftSize = $("#fieldStreetName").css('font-size');
	centrLeftSize = +centrLeftSize.slice(0, centrLeftSize.indexOf('p'));

	var CentrLeftHeight = centrLeftSize / 4;

	var inputRightSize = $("#fieldHouseNumber").css('font-size');
	inputRightSize = +inputRightSize.slice(0, inputRightSize.indexOf('p'));

	var InputRightHeight = inputRightSize / 4;

	var doc = new jsPDF({ orientation: 'landscape', format: [width, height] });

	doc.addFileToVFS('Roboto-Bold.ttf', '');
	doc.addFont('Roboto-Bold.ttf', 'custom', 'normal');
	doc.setFont('custom');

	doc.setFillColor(34, 30, 85);
	doc.roundedRect(width - height, 0, height, height, 3, 3, "F");

	doc.setTextColor(234, 235, 240);
	doc.setFontSize(inputRightSize * 3);
	doc.writeText(width - height, (height / 2 + InputRightHeight + InputRightHeight / 2), $("#fieldHouseNumber").val(), { align: 'center', width: height });

	doc.setTextColor(34, 30, 85);

	doc.setFontSize(centrLeftSize * 3);
	doc.writeText(0, (height / 2 + CentrLeftHeight + CentrLeftHeight / 2), $("#fieldStreetName").val(), { align: 'center', width: width - height });

	doc.addFileToVFS('Roboto-Medium.ttf', '');
	doc.addFont('Roboto-Medium.ttf', 'custom', 'normal');
	doc.setFont('custom');

	doc.setFontSize(inputLeftSize * 3);

	doc.writeText(0, (12 + inputLeftSize), $("#fieldStreet").val(), { align: 'center', width: width - height });

	doc.text($("#fieldLastHouseNumber").val(), 22.5, (height - 12 - InputLeftHeight));

	doc.text($("#fieldNextHouseNumber").val(), width - height - 22.5, (height - 12 - InputLeftHeight), { align: 'right' });

	doc.addFileToVFS('Roboto-MediumItalic.ttf', '');
	doc.addFont('Roboto-MediumItalic.ttf', 'custom', 'normal');
	doc.setFont('custom');

	doc.writeText(0, (height - 12 - InputLeftHeight), $("#fieldStreetNameEnglish").val(), { align: 'center', width: width - height });

	doc.save($("#fieldStreetName").val() + '.pdf')

}



var options = {
	url: "./resources/street.json",

	getValue: "fieldStreetName",

	list: {
		match: {
			enabled: true
		},

		onSelectItemEvent: function () {
			var fieldStreet = $("#fieldStreetName").getSelectedItemData().fieldStreet;
			var fieldStreetName = $("#fieldStreetName").getSelectedItemData().fieldStreetName;
			var fieldStreetNameEnglish = $("#fieldStreetName").getSelectedItemData().fieldStreetNameEnglish;

			$("#fieldStreet").val(fieldStreet).trigger("change");
			$("#fieldStreetName").val(fieldStreetName).trigger("change");
			$("#fieldStreetNameEnglish").val(fieldStreetNameEnglish).trigger("change");

			resizeForm();

			$("#eac-container-fieldStreetName").width($("#fieldStreetName").width() + 4);
			$('#eac-container-fieldStreetName').css('left', $("#fieldStreetName").position().left + 'px');
		}
	}
};

$("#fieldStreetName").easyAutocomplete(options);
